import { Component } from "react";
import "./RobotInGame.css";

export default class RobotInGame extends Component({image, x, y}) {

    style = {
        top: `${x}px`,
        left: `${y}px`
    }

    render () {
        return (
            <div style = {this.style} id="RobotInGame">
                <img src={image} alt=""></img>
            </div>);
    }
}
